    # In order to get the maximum possible number of '0' and '1',
    # we need to start with the string having the maximum number of '0' and '1'
    # and reduce the number of '0' and '1' by one until we have the minimum number of '0' and '1'
    zeros = 0
    ones = 0
    for c in s:
        if c == '0':
            zeros += 1
        else:
            ones += 1

    # We need to reduce the number of '0' and '1' by one until we have the minimum number of '0' and '1'
    # In this loop we try to find the minimum number of '0' and '1' by reducing the number of '0' and '1' by one
    # until it is less than or equal to the maximum number of '0' and '1'
    while zeros > 0 or ones > 0:
        if zeros > ones:
            zeros -= 1
        else:
            ones -= 1

    # We need to reduce the number of '0' and '1' by one until we have the maximum number of '0' and '1'
    # In this loop we try to find the maximum number of '0' and '1' by reducing the number of '0' and '1' by one
    # until it is less than or equal to the minimum number of '0' and '1'
    while zeros < n - 1 or ones < n - 1:
        if zeros < ones:
            zeros += 1
        else:
            ones += 1

    # If the number of '0' and '1' is not equal to one, then it is impossible to color the string so that it can be sorted
