    for x in range(n):
        group = find(x)
        if group in groups:
            groups[group].append(x)
        else:
            groups[group] = [x]

    groups = list(groups.values())

    def dfs(group: List[int]) -> bool:
        roots = {}

        def find(x: int) -> int:
            if x in roots:
                return roots[x]
            roots[x] = x
            return x

        for x in group:
            find(x)

        max_diameter = 0
        for x in group:
            root = find(x)

            if len(roots) == 1:
                return True

            root_diameter = 0
            for y in group:
                if x!= y:
                    if root == find(y):
                        root_diameter += 1

            max_diameter = max(max_diameter, root_diameter)

        return max_diameter <= d

    res = 0
    for group in groups:
        if dfs(group):
            res = len(group)
            break

    if res == 0:
        return "NO"

