def solution(stdin: str) -> str:
    """Finds the value of θ given a list of points.

    Args:
        stdin (str): The input string

    Returns:
        str: The output string
    """
    points = [tuple(map(float, line.split())) for line in stdin.strip().split('\n')]
    x_min, x_max = min(p[0] for p in points), max(p[0] for p in points)
    y_min, y_max = min(p[1] for p in points), max(p[1] for p in points)

    def within(p):
        return p[0] >= x_min and p[0] <= x_max and p[1] >= y_min and p[1] <= y_max

    def helper(p1, p2):
        x1, y1 = p1
        x2, y2 = p2
        return atan2(x1 - x2, y1 - y2)

    def angle(p1, p2, p3):
        return math.pi / 2 - abs(helper(p1, p3) - helper(p2, p3))

    def center(p1, p2, p3):
        x1, y1 = p1
        x2, y2 = p2
        x3, y3 = p3
        return ((x1 + x2 + x3) / 3, (y1 + y2 + y3) / 3)

    points = list(filter(within, points))
    n = len(points)
    if n == 0: return 'n/a'
    if n == 1: return '0'
    angles = {p : angle(center(points[0], p, points[1]), points[0], p) for p in points}
    return '{:.2f}'.format(sum(angles.values()) / n)

