def solution(stdin: str) -> str:
    """Returns the minimum number of days Polycarp needs to do it.
    """
    stdin = stdin.strip().split("\n")
    cups, pages = [int(n) for n in stdin[0].split()]
    caffeine = [int(n) for n in stdin[1].split()]
    caffeine.sort()
    pages_to_caffeine = {}
    for page, caffeine in zip(pages, caffeine):
        if caffeine in pages_to_caffeine:
            pages_to_caffeine[caffeine].append(page)
        else:
            pages_to_caffeine[caffeine] = [page]

    max_caffeine = max(caffeine)
    if max_caffeine < pages:
        return -1

    # Convert to linear sum of pages and cups
    caffeine.append(pages)
    caffeine.sort()

    days = 0
    for cup in range(max_caffeine, 0, -1):
        day = 0
        for page in range(cup, 0, -1):
            page_to_write = max(0, page - cup + 1)
            day += page_to_write
            for caffeine in pages_to_caffeine.keys():
                if cup - caffeine + 1 >= 0:
                    if page < pages_to_caffeine[caffeine][0]:
                        break
                    page_to_write = max(0, page - caffeine + 1)
                    day += page_to_write
                    pages_to_caffeine[caffeine].pop(0)
                    if len(pages_to_caffeine[caffeine]) == 0:
                        del pages_to_caffeine[caffeine]
                    break
            if page < pages:
                break
        days = day
        if days == pages:
