    >>> solution('5 5\n.*...\n****.\n.****\n..**.\n.....')
    3
    >>> solution('3 3\n*.*\n.*.\n*.*')
    -1
    >>> solution('5 5\n.*...\n*.*.*\n.*.*.*\n.*.*.*\n.....')
    3
    >>> solution('3 3\n****\n*.*\n.*.')
    -1
    >>> solution('5 5\n.*...\n****.\n.*.*.\n.*.*.\n.....')
    3
    >>> solution('3 3\n.*.\n*.*\n*.*')
    2 2 1
    """
    n, m = [int(x) for x in stdin.split(' ')]
    grid = [list(stdin.split('\n')[i]) for i in range(n)]

    stars = [0] * n
    for r in range(n):
        for c in range(m):
            if grid[r][c] == '*':
                stars[r] += 1

    def dfs(left, right, top, bottom, count):
        if left < right or top < bottom:
            return
        if left > n * m or top > n * m:
            return
        if left == right and top == bottom:
            if left > count:
                stars[top // n] = left
            return
        if left + right > n * m or top + bottom > n * m:
            return
        if left == right:
            dfs(left, right + 1, top, bottom, count)
            dfs(left + 1, right, top, bottom, count)
            return
        if top == bottom:
            dfs(left, right, top + 1, bottom, count)
            dfs(left, right, top + 1, bottom, count)
            return

        dfs(left, right, top, bottom + 1, count)
        dfs(left, right, top + 1, bottom, count)
        dfs(left + 1, right, top, bottom, count)
        dfs(left, right + 1, top, bottom, count)

    count = 0
    for r in range(n):
        for c in range(m):
            if grid[r][c] == '*':
                dfs(1, stars[r], r + 1, c + 1, count)
                count += 1

    result = '0'
    if count <= n * m:
        for i in range(n):
            for j in range(m):
                if stars[i] == 0:
                    if grid[i][j] == '.':
                        continue
                    return '-1'
                result = str(stars[i]) +'' + result
        return result

