    template = stdin.splitlines()[2:]
    test = stdin.splitlines()[:2]

    if n < 2 or m < 2:
        return 'No'
    # If the template image has less than 2 rows or columns, it cannot be contained in the image.
    if any(len(x) < 2 for x in template):
        return 'No'
    if any(len(x) < 2 for x in test):
        return 'No'
    # Check whether the template can be extended to the right and down to contain the test image.
    right, down = n - 1, m - 1
    for j in range(m):
        for i in range(n):
            if template[j][i]!= test[j][i]:
                right = min(right, i)
                down = min(down, j)
                break

    for i in range(n):
        for j in range(m):
            if template[j][i]!= test[j][i]:
                right = min(right, i)
                down = min(down, j)
                break

    if right < n - 2 and down < m - 2:
        return 'No'

    # If we cannot extend the test image to the right and down, check whether the template can be contained in the test image.
    right = n - 1
    down = m - 1
    for j in range(m):
        for i in range(n):
            if template[j][i]!= test[j][i]:
                right = min(right, i)
                down = min(down, j)
                break

    for i in range(n):
        for j in range(m):
            if template[j][i]!= test[j][i]:
                right = min(right, i)
                down = min(down, j)
                break

    if right < n - 2 or down < m - 2:
        return 'No'

    return 'Yes'

