def solution(stdin: str) -> str:
    """Return string answer which is the largest number of children content.
    """
    # 方法一，使用暴力搜索方法
    # 时间复杂度O(NlogN)，N为cookie的个数
    # 空间复杂度O(N)，只需要存储最小的一个cookie
    def max_children_num(cookies, childrens):
        children_content = []
        for child, cookie in zip(childrens, cookies):
            if cookie >= child:
                children_content.append(1)
            else:
                children_content.append(0)
        return children_content.count(1)

    children_num = len(childrens)
    cookie_num = len(cookies)

    # 每个child最少需要有几个cookie
    # 方法二，使用二分法解决问题
    # 时间复杂度O(NlogN)，N为cookie的个数
    # 空间复杂度O(N)，只需要存储最小的一个cookie
    def binary_search(left, right, cookies, childrens):
        while left <= right:
            mid = (left + right) // 2
            # 统计有多少个child content
            content = max_children_num(cookies[mid:], childrens)
            if content >= children_num:
                return mid
            elif content < children_num:
                right = mid - 1
        return right

    return binary_search(0, cookie_num, cookies, childrens)

