    """
    Finds out whether it is possible to lighten up Button 2 in the AtCoder Gym.
    """
    N, *answers = map(int, stdin.split())
    # The first line: N, the second line: a_i = 1, the third line:...
    # The last line: a_i = N

    # Use 2 pointers to solve this problem:
    # p1: the pointer to the first button, always points to the first button which is lighten up
    # p2: the pointer to the button which is "the next" to the last button which is lighten up
    # You can use 1,2,...,N to represent the button numbers
    p1, p2 = 0, 1
    # If button i is not lighten up:
    # => p1 always points to the next button which is lighten up (p2 always points to the next button which is lighten up)
    # If button i is lighten up:
    # => p1 points to the last button which is lighten up, and p2 points to the next button which is lighten up
    # If p1==p2, it means that p1 and p2 are adjacent to each other, and p2 is the first button that is lighten up (p1 is the first button that is not lighten up).
    # If p1>p2, it means that p1 is the first button that is lighten up, and p2 is the first button that is not lighten up.
    # If p1<p2, it means that p1 is the first button that is not lighten up, and p2 is the first button that is lighten up.
    while p1 < N and p2 < N:
        if p1+1 == p2:
            if answers[p1] == p2:
                p2 += 1
            elif answers[p1] == p1+1:
                p1 += 1
            elif answers[p1] == p2+1:
                p2 += 1
            elif answers[p1] == p1:
                p1 += 1
        elif p1+1 > p2:
            if answers[p1] == p2:
                p2 += 1
            elif answers[p1] == p1+1:
                p1 += 1
            elif answers[p1] == p2+1:
                p2 += 1
            elif answers[p1] == p1:
                p1 += 1
        elif p1+1 < p2:
            if answers[p1] == p2:
                p2 += 1
            elif answers[p1] == p2+1:
                p2 += 1
            elif answers[p1] == p1:
                p1 += 1
            elif answers[p1] == p1+1:
                p1 += 1
        if p1 == p2:
            return str(p2-1)
    return '-1'

